"Teie loal kogub OnePlus telefoni kasutusandmeid tootedisaini ja kasutuskogemuse täiustamiseks. Kui nõustute osalema kasutajakogemuse programmis („Programm“), nõustute sellega, et OnePlus võib koguda, kasutada ja analüüsida järgmiseid andmeid: 
 (1) konfiguratsiooniandmed;
 (2) rakendusprogrammi statistikaandmed;
 (3) kasutaja käitumisandmed.
 Ülal mainitud andmeid kogudes ja analüüsides püüab OnePlus täiustada kasutajakogemust, nt parandades aku tõhusust ja süsteemi stabiilsust – see on anonüümne ning krüptitud. Andmeid ei kasutata isiku tuvastamiseks. Kui olete programmiga liitunud, saate nõusoleku tühistada, kui valite Sätted – Täpsem – Kasutajakogemuse programm ja kustutate ruudust märke. Lisateavet OnePlusi töödeldavate andmete kohta leiate OnePlusi privaatsuspoliitikast. Kui olete programmist lahkunud, lõpetab OnePlus ülal mainitud andmete kogumise."
